import React from 'react';
import BaseLayer from './BaseLayer';

class ConcatLayer extends BaseLayer {
    constructor(props) {
        super(props);
        this.state = {
            layers: props.layers || [],
        };
    }

    render() {
        return (
            <div className="concat-layer">
                <h3>Concat Layer</h3>
                <p>Layers to concatenate:</p>
                <ul>
                    {this.state.layers.map((layer, index) => (
                        <li key={index}>{layer.name}</li>
                    ))}
                </ul>
            </div>
        );
    }
}

export default ConcatLayer;
